function minSum(nums1: number[], nums2: number[]): number {
    let sum1 = nums1.reduce((a, b) => a + b, 0);
    let sum2 = nums2.reduce((a, b) => a + b, 0);
    let diff = Math.abs(sum1 - sum2);
    let zeros1 = nums1.filter(x => x === 0).length;
    let zeros2 = nums2.filter(x => x === 0).length;

    if (zeros1 + zeros2 === 0) return sum1 === sum2 ? sum1 : -1;

    let minSumAfterReplacement = Math.max(sum1, sum2) + diff;
    if (sum1 < sum2) {
        if (zeros1 === 0) return -1;
        minSumAfterReplacement = sum2 + zeros1;
    } else if (sum2 < sum1) {
        if (zeros2 === 0) return -1;
        minSumAfterReplacement = sum1 + zeros2;
    } else {
        minSumAfterReplacement += Math.min(zeros1, zeros2);
    }

    return minSumAfterReplacement;
};
